// import logo from './logo.sv  g';
import './App.css';
import HomeComponent from './components/home';
import { ThemeProvider } from './store/themeContext';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import ChatRoom from './components/chat/chat';

function App() {
  return (
    <ThemeProvider>

      <Router>
      <li>
              <Link to="/chatRoom">Users</Link>
            </li>
        <Switch>
          <Route path="/">
            <HomeComponent />
          </Route>
          <Route path="/chatRoom">
            <ChatRoom />
          </Route>
        </Switch>
      </Router>
    </ThemeProvider>
  );
}

export default App;
